def count_binary_seq(n):
    mod = 10**9 + 7
    dp = [[0 for _ in range(2)] for _ in range(n + 1)]
    dp[0][0] = 1
    for i in range(1, n + 1):
        for j in range(2):
            dp[i][j] = (dp[i - 1][j] * 2) % mod
            if j == 0:
                dp[i][j] = (dp[i][j] + dp[i - 1][1]) % mod
    return dp[n][0]

