def find_minimum_range(lists):
    # Find the minimum and maximum elements in the lists
    min_element = min(min(lst) for lst in lists)
    max_element = max(max(lst) for lst in lists)

    # Initialize the minimum range
    min_range = max_element - min_element

    # Iterate over all possible ranges
    for i in range(min_element, max_element + 1):
        # Check if the range includes at least one element from each list
        is_valid = True
        for lst in lists:
            if i not in lst:
                is_valid = False
                break

        # If the range is valid, update the minimum range
        if is_valid and min_range > max_element - i:
            min_range = max_element - i

    # Return the minimum range
    return (max_element - min_range, max_element)

