        return find_kth(arr2, arr1, n, m, k)
    low = max(0, k - n)
    high = min(m, k)
    while low <= high:
        cut1 = (low + high) // 2
        cut2 = k - cut1
        l1 = -1 if cut1 == 0 else arr1[cut1 - 1]
        l2 = -1 if cut2 == 0 else arr2[cut2 - 1]
        r1 = arr1[cut1] if cut1 != m else float('inf')
        r2 = arr2[cut2] if cut2 != n else float('inf')
        if l1 <= r2 and l2 <= r1:
            return max(l1, l2)
        elif l1 > r2:
            high = cut1 - 1
        else:
            low = cut1 + 1
    return None

