def maxAverageOfPath(matrix, n): 
    dp = [[0 for i in range(n)] for j in range(n)] 
    dp[0][0] = matrix[0][0] 
    for i in range(1, n): 
        dp[i][0] = dp[i - 1][0] + matrix[i][0] 
    for j in range(1, n): 
        dp[0][j] = dp[0][j - 1] + matrix[0][j] 
    for i in range(1, n): 
        for j in range(1, n): 
            dp[i][j] = max(dp[i - 1][j], dp[i][j - 1]) + matrix[i][j] 
    return dp[n - 1][n - 1] / (n * n)

