    for num in nums:
        if len(max_heap) < 3:
            heapq.heappush(max_heap, num)
        else:
            # If the current number is greater than the smallest number in the heap, replace the smallest number with the current number
            if num > max_heap[0]:
                heapq.heappop(max_heap)
